import React, { Component } from "react";
import {
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBBtn,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBTabPane,
  MDBTabContent,
  MDBNav,
  MDBNavItem,
  MDBNavLink,
  MDBIcon,
  MDBDropdown,
  MDBDropdownToggle,
  MDBDropdownMenu,
  MDBDropdownItem,
  MDBModal,
  MDBModalBody,
  MDBModalFooter,
  MDBInput
} from "mdbreact";
import DocsLink from "../../components/docsLink";
import SectionContainer from "../../components/sectionContainer";

class PillsPage extends Component {
  state = {
    modal1: false,

    items: {
      default: "1",
      justified: "1",
      dropdown: "1",
      vertical: "1",
      gradient: "1",
      rounded: "1",
      rounded2: "1",
      roundedGradient: "1",
      roundedGradient2: "1",
      roundedOutline: "1",
      roundedOutline2: "1",
      icons: "1",
      iconsRight: "1",
      content: "1",
      contentCard: "1",
      animation: "1",
      animationRO: "1",
      animationR: "1",
      modal: "1",
      outer: "1",
      inner: "1"
    }
  };

  togglePills = (type, tab) => e => {
    e.preventDefault();
    if (this.state.items[type] !== tab) {
      let items = { ...this.state.items };
      items[type] = tab;
      this.setState({
        items
      });
    }
  };

  toggle = nr => () => {
    let modalNumber = "modal" + nr;
    this.setState({
      [modalNumber]: !this.state[modalNumber]
    });
  };

  componentDidMount() {
    this.Styles();
  }
  Styles = () => {
    let style = document.createElement("style");
    style.innerHTML = `
      /* Remove outline (border if you click button) */
      a,
      li,
      a::-moz-focus-inner,
      li::-moz-focus-inner,
      a:focus,
      li:focus,
      select:-moz-focusring,
      button::-moz-focus-inner {
        outline: none !important;
      }

      /* Gradient buttons */
      .pills-peach-gradient .nav-item .nav-link.active {
        background: linear-gradient(40deg, #ffd86f, #fc6262);
      }
      .pills-blue-gradient .nav-item .nav-link.active {
        background: linear-gradient(40deg, #45cafc, #303f9f);
      }
      .pills-purple-gradient .nav-item .nav-link.active {
        background: linear-gradient(40deg, #ff6ec4, #7873f5);
      }
      .pills-aqua-gradient .nav-item .nav-link.active {
        background: linear-gradient(40deg, #2096ff, #05ffa3);
      }

      /* Rounded buttons and outline*/
      .pills-rounded .nav-item .nav-link {
        border-radius: 10em;
      }
      .pills-light-purple .nav-item .nav-link.active {
        background-color: #ba68c8;
      }

      .pills-outline-red .nav-item .nav-link {
        border: 2px solid transparent;
        color: #666;
        background-color: transparent;
      }
      .pills-outline-red .nav-item .nav-link:hover {
        border: 2px solid #fff;
      }
      .pills-outline-red .nav-item .nav-link.active {
        border: 2px solid #f44336;
        color: #f44336;
      }
      .pills-outline-red .nav-item .nav-link.active:hover {
        border: 2px solid #f44336;
        color: #f44336;
      }

      .pills-outline-green .nav-item .nav-link {
        border: 2px solid transparent;
        color: #666;
        background-color: transparent;
      }
      .pills-outline-green .nav-item .nav-link:hover {
        border: 2px solid #fff;
      }
      .pills-outline-green .nav-item .nav-link.active {
        border: 2px solid #4caf50;
        color: #4caf50;
      }
      .pills-outline-green .nav-item .nav-link.active:hover {
        border: 2px solid #4caf50;
        color: #4caf50;
      }


      /* Colors animations */

      .pills-blue-teal .nav-item .nav-link.active {
        background-color: #4fc3f7;
        -webkit-animation-name: example; /* Safari 4.0 - 8.0 */
        -webkit-animation-duration: 4s; /* Safari 4.0 - 8.0 */
        animation-name: example;
        animation-duration: 4s;
        }
        /* Safari 4.0 - 8.0 */
        @-webkit-keyframes example {
        from {background-color: #4fc3f7;}
        to {background-color: #009688;}
        }

        /* Standard syntax */
        @keyframes example {
        from {background-color: #4fc3f7;}
        to {background-color: #009688;}
        }

        .pills-outline-purple-anm .nav-item .nav-link.active {
        border: 2px solid #9c27b0;
        color: #9c27b0;
        background-color: transparent;
        -webkit-animation-name: outline; /* Safari 4.0 - 8.0 */
        -webkit-animation-duration: 4s; /* Safari 4.0 - 8.0 */
        animation-name: outline;
        animation-duration: 4s;
        }
        /* Safari 4.0 - 8.0 */
        @-webkit-keyframes outline {
        from {border: 2px solid #9c27b0; color: #9c27b0;}
        to {border: 2px solid #f48fb1; color: #f48fb1;}
        }

        /* Standard syntax */
        @keyframes outline {
        from {border: 2px solid #9c27b0; color: #9c27b0;}
        to {border: 2px solid #f48fb1; color: #f48fb1;}
        }

        .pills-orange-anm .nav-item .nav-link.active {
        background-color: #ffa000 ;
        -webkit-animation-name: orange; /* Safari 4.0 - 8.0 */
        -webkit-animation-duration: 4s; /* Safari 4.0 - 8.0 */
        animation-name: orange;
        animation-duration: 4s;
        }
        /* Safari 4.0 - 8.0 */
        @-webkit-keyframes orange {
        from {background-color: #ffa000 ;}
        to {background-color: #f44336;}
        }

        /* Standard syntax */
        @keyframes orange {
        from {background-color: #ffa000 ;}
        to {background-color: #f44336;}
        }
      `;
    let firstScriptTag = document.querySelector("script");
    firstScriptTag.parentNode.insertBefore(style, firstScriptTag);
  };
  render() {
    return (
      <MDBContainer>
        <DocsLink title="Pills" href="https://mdbootstrap.com/docs/react/components/pills/" />

        <MDBContainer className="mt-4">
          <MDBRow>
            <MDBCol md="12">
              <SectionContainer header="Basic example">
                <MDBNav pills color="secondary">
                  <MDBNavItem>
                    <MDBNavLink
                      to="#"
                      active={this.state.items["default"] === "1"}
                      onClick={this.togglePills("default", "1")}
                    >
                      Active
                    </MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink
                      to="#"
                      active={this.state.items["default"] === "2"}
                      onClick={this.togglePills("default", "2")}
                    >
                      Link
                    </MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink
                      to="#"
                      active={this.state.items["default"] === "3"}
                      onClick={this.togglePills("default", "3")}
                    >
                      Link
                    </MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink
                      to="#"
                      active={this.state.items["default"] === "4"}
                      onClick={this.togglePills("default", "4")}
                    >
                      Help
                    </MDBNavLink>
                  </MDBNavItem>
                </MDBNav>
                <MDBTabContent activeItem={this.state.items["default"]}>
                  <MDBTabPane tabId="1">
                    <p>
                      Lorem ipsum dolor sit amet, consectetur adipisicing elit. Nihil odit magnam minima, soluta
                      doloribus reiciendis molestiae placeat unde eos molestias. Quisquam aperiam, pariatur.
                      Tempora, placeat ratione porro voluptate odit minima.
                    </p>
                  </MDBTabPane>
                  <MDBTabPane tabId="2">
                    <p>
                      Nihil odit magnam minima, soluta doloribus reiciendis molestiae placeat unde eos molestias.
                      Quisquam aperiam, pariatur. Tempora, placeat ratione porro voluptate odit minima.
                    </p>
                  </MDBTabPane>
                  <MDBTabPane tabId="3">
                    <p>
                      Tempora, placeat ratione porro voluptate odit minima. Nihil odit magnam minima, soluta
                      doloribus reiciendis molestiae placeat unde eos molestias.
                    </p>
                  </MDBTabPane>
                  <MDBTabPane tabId="4">
                    <p>
                      Lorem ipsum dolor sit amet, consectetur adipisicing elit. Nihil odit magnam minima, soluta
                      doloribus reiciendis molestiae placeat unde eos molestias. Quisquam aperiam, pariatur.
                    </p>
                  </MDBTabPane>
                </MDBTabContent>
              </SectionContainer>

              <SectionContainer header="Justified">
                <MDBNav pills color="pink" className="nav-justified">
                  <MDBNavItem>
                    <MDBNavLink
                      to="#"
                      active={this.state.items["justified"] === "1"}
                      onClick={this.togglePills("justified", "1")}
                    >
                      Active
                    </MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink
                      to="#"
                      active={this.state.items["justified"] === "2"}
