                    </MDBNavLink>
                  </MDBNavItem>
                </MDBNav>
              </SectionContainer>

              <SectionContainer header="With dropdown">
                <MDBNav pills color="success" className="nav-justified ">
                  <MDBNavItem>
                    <MDBNavLink
                      to="#"
                      active={this.state.items["dropdown"] === "1"}
                      onClick={this.togglePills("dropdown", "1")}
                    >
                      Active
