                </MDBNav>
              </SectionContainer>

              <SectionContainer header="Vertical" >
                <MDBRow className="d-flex justify-content-center">
                  <MDBCol md="6" >
                    <MDBNav pills color="primary" className="flex-column">
                      <MDBNavItem>
                        <MDBNavLink
                          to="#"
